import React, {Component} from 'react'
import TicketService from '../services/TicketService';

class ListTicketComponent extends Component{
    constructor(props){
        super(props)

        this.state = {
            tickets: [],
          };

    }

    componentDidMount(){
        TicketService.getTickets().then((res) => {
            this.setState({Tickets: res.data})
        });
    }

    render(){
        return(
        <div>
            <h2 className="text-centre"> Tickets</h2>
                <div className = "row"> 
                    <table classname ="table table-striped table-bordered" >
                        <thead> 
                            <tr>
                                <th>id </th>
                                <th>author </th>
                                <th>description </th>
                                <th>title </th>
                                <th>status </th>
                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.tickets.map(
                                    tickets =>
                                    <tr key = {tickets.id}>
                                    <td key = {tickets.author}></td>
                                    <td key = {tickets.description}></td>
                                    <td key = {tickets.title}></td>
                                    <td key = {tickets.status}></td>
                                    </tr>
                                )
                            }
                        </tbody>

                    </table>
                </div>
        </div>
        )
    }
    
}

export default ListTicketComponent
